import React, { Component } from "react";
// write a react component that renders an input element
// and a button element
// when the button is clicked, the input value should be logged to the console
class Input extends Component {
    constructor(props) {
        super(props);
    }

  render () {
    return <form>
        <input placeholder={this.props.p1} type="text" /><br />

        <button>SUBMIT</button>
    </form>
  }
}

export default Input;
